import React from "react";
import { useHistory } from "react-router-dom";

function BackButton() {
  let history = useHistory();
  return (
    <div>
      <button type="button" onClick={() => history.goBack()}>
        返回
      </button>
      {/* <button type="button" onClick={() => history.goForward()}>
        前进
      </button> */}
    </div>
  );
}
export default BackButton;
